import "./box.css";
const College =(props) =>
{
    return(

          <div class="col">
            <h1> {props.clgname}</h1>
             <hr />
             <div className="box">
              Course : {props.clgcourse}
              <br />
              Fees :  {props.clgfees}
              <br />
              About College : {props.clgabout}
             </div>
            </div>  
    );
}
export default College;
